import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
const productArr = [
  {
    img: "https://m.media-amazon.com/images/I/71geVdy6-OS._AC_UL480_QL65_.jpg",
    name1: "OPPO A74 5G",
    price: "₹17,990",
    varient: "(Fantastic Purple,6GB RAM,128GB Storage)",
    features:
      "5G Android Smartphone | 5000 mAh Battery | 18W Fast Charge | 90Hz LCD Display",
  },
  {
    img: "https://m.media-amazon.com/images/I/61TnX0PmqES._AC_UL320_.jpg",
    name1: "OnePlus Nord 2 5G ",
    price: "₹29,999",
    varient: "(Blue Haze, 8GB RAM, 128GB Storage)",
    features:
      "5G Android Smartphone | 4500 mAh Battery | 30W Fast Charge | 90Hz Fluid AMOLED Display",
  },
  {
    img: "https://m.media-amazon.com/images/I/61uIgwiP90S._AC_UL480_QL65_.jpg",
    name1: "iQOO Z3 5G",
    price: "₹20,990",
    varient: "((Ace Black, 8GB RAM, 128GB Storage)",
    features:
      "India's First SD 768G 5G Processor | 55W FlashCharge | Upto 9 Months No Cost EMI | 6 Months Free Screen Replacement",
  },
  {
    img: "https://images-eu.ssl-images-amazon.com/images/I/41AjH0ZksDL._AC_SX184_.jpg",
    name1: "Samsung Galaxy Note10 Lite",
    price: "₹45,068",
    varient: "(Aura Black, 8GB RAM, 128GB Storage)",
    features:
      "Triple Camera Setup | super Amoled infinity-O display | 4500mAH lithium-ion battery",
  },
];

function Output() {
  return (
    <div className="productElements">
      {productArr.map((product) => {
        return <Product product={product} />;
      })}
    </div>
  );
}

function Product(props) {
  const { img, name1, price, varient, features, childern } = props.product;
  return (
    <div className="product">
      <img src={img} className="productImg" />
      <name>{name1}</name>
      <price>{price}</price>
      <varient>{varient}</varient>
      <features>{features}</features>
    </div>
  );
}
ReactDOM.render(<Output />, document.getElementById("root"));
